import React, { useState } from "react";

// Replace this with your real Formspree endpoint
const FORMSPREE_ENDPOINT = "https://formspree.io/f/yourformid";

const SERVICE_OPTIONS = [
  "Bordados",
  "Serigrafía",
  "Sublimación",
  "Grabado",
  "Otro",
];

function FormspreeContactForm() {
  const [form, setForm] = useState({ name: "", email: "", message: "", services: [] });
  const [status, setStatus] = useState(null);
  const [loading, setLoading] = useState(false);

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleServiceChange = (e) => {
    const { value, checked } = e.target;
    setForm((prev) => {
      const services = prev.services.includes(value)
        ? prev.services.filter((s) => s !== value)
        : [...prev.services, value];
      return { ...prev, services };
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setStatus(null);
    try {
      const response = await fetch(FORMSPREE_ENDPOINT, {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
          Accept: "application/json",
        },
        body: JSON.stringify({
          ...form,
          services: form.services.join(", "),
        }),
      });
      const data = await response.json();
      if (data.ok) {
        setStatus("SUCCESS");
        setForm({ name: "", email: "", message: "", services: [] });
      } else {
        setStatus("ERROR");
      }
    } catch (err) {
      setStatus("ERROR");
    } finally {
      setLoading(false);
    }
  };

  return (
    <form className="space-y-4" onSubmit={handleSubmit}>
      <div>
        <label htmlFor="name" className="block text-gray-700 font-bold mb-1">Nombre</label>
        <input
          type="text"
          id="name"
          name="name"
          value={form.name}
          onChange={handleChange}
          required
          className="w-full border border-gray-300 p-2 rounded-md focus:outline-none focus:ring-2 focus:ring-[#D48C54]"
          placeholder="Tu nombre completo"
        />
      </div>
      <div>
        <label htmlFor="email" className="block text-gray-700 font-bold mb-1">Email</label>
        <input
          type="email"
          id="email"
          name="email"
          value={form.email}
          onChange={handleChange}
          required
          className="w-full border border-gray-300 p-2 rounded-md focus:outline-none focus:ring-2 focus:ring-[#D48C54]"
          placeholder="tu@email.com"
        />
      </div>
      <div>
        <label className="block text-gray-700 font-bold mb-1">¿Qué tipo de servicio buscas?</label>
        <div className="flex flex-wrap gap-4">
          {SERVICE_OPTIONS.map((option) => (
            <label key={option} className="flex items-center space-x-2">
              <input
                type="checkbox"
                name="services"
                value={option}
                checked={form.services.includes(option)}
                onChange={handleServiceChange}
                className="accent-[#D48C54]"
              />
              <span>{option}</span>
            </label>
          ))}
        </div>
      </div>
      <div>
        <label htmlFor="message" className="block text-gray-700 font-bold mb-1">Cuéntanos qué necesitas</label>
        <textarea
          id="message"
          name="message"
          rows="5"
          value={form.message}
          onChange={handleChange}
          required
          className="w-full border border-gray-300 p-2 rounded-md focus:outline-none focus:ring-2 focus:ring-[#D48C54]"
          placeholder="¿Qué tipo de servicio buscas?"
        ></textarea>
      </div>
      <button
        type="submit"
        className="bg-[#D48C54] hover:bg-[#2C345C] text-white px-6 py-3 rounded-md w-full transition-colors"
        disabled={loading}
      >
        {loading ? "Enviando..." : "Enviar mensaje"}
      </button>
      {status === "SUCCESS" && (
        <p className="text-green-600 text-center mt-4">¡Gracias! Tu mensaje fue enviado correctamente.</p>
      )}
      {status === "ERROR" && (
        <p className="text-red-600 text-center mt-4">Hubo un error al enviar el mensaje. Intenta de nuevo.</p>
      )}
    </form>
  );
}

export default FormspreeContactForm;
